import React from 'react';
import style from './Header.module.css';
import {NavLink} from 'react-router-dom';

const MenuItem = (props) => {
    return (
        <div className={style.item}>
            <NavLink to={props.path} activeClassName={style.activeLink}>props.title</NavLink>
        </div>
    );
};


const Header = () => {
    return(
        <div className={style.header}>
            <div className={style.topPanel}></div>
            <div className={style.menu}>
                <MenuItem path='/Catalog' title='Каталог' />
                <MenuItem path='/Stocks' title='Акции' />
                <MenuItem path='/Services' title='Услуги' />
                <MenuItem path='/Shipping' title='Доставка и оплата' />
                <MenuItem path='/Contacts' title='Контакты' />
                <div className={style.item}>
                    <NavLink to='/Catalog' activeClassName={style.activeLink}>Каталог</NavLink>
                </div>
                <div className={style.item}>
                    <NavLink to='/Stocks' activeClassName={style.activeLink}>Акции</NavLink>
                </div>
                <div className={style.item}>
                    <NavLink to='/Services' activeClassName={style.activeLink}>Услуги</NavLink>
                </div>
                <div className={style.item}>
                    <NavLink to='/Shipping' activeClassName={style.activeLink}>Доставка и оплата</NavLink>
                </div>
                <div className={style.item}>
                    <NavLink to='/Contacts' activeClassName={style.activeLink}>Контакты</NavLink>
                </div>
                <div className={style.item}>
                    <a>
                        <img src=''></img>
                    </a>
                </div>
            </div>
            <div className={style.bottomPanel}></div>
        </div>
    )
};

export default Header;
